function SSB() {
    const [path, setPath] = useState('');
    const [fileName, setFileName] = useState('');
    const [text, setText] = useState(false);
    const [result, setResult] = useState('');
    const [timers,setTimers]=useState(true);

    useEffect(() => {
        if (path.length && fileName.length) {
            const duration = 5;
            const display = document.querySelector('.timer');
            if (display) {
                startTimer(duration, display);
            }
        }
    }, [path, fileName]);

    function startTimer(duration, display) {
        let timer = duration, minutes, seconds;
        const interval = setInterval(() => {
            minutes = parseInt(timer / 60, 10);
            seconds = parseInt(timer % 60, 10);

            minutes = minutes < 10 ? "0" + minutes : minutes;
            seconds = seconds < 10 ? "0" + seconds : seconds;

            display.textContent = minutes + ":" + seconds;

            if (--timer < 0) {
                clearInterval(interval);
                if(!text)  
                setText(true)
                else
                {handleSubmit();};
            }
        }, 1000);
    }

    async function handleSubmit(event) {
        if (event) event.preventDefault();
        setTimers(false);
        const formData = {
            story: document.querySelector('.imgdes').value
        };
        try {
            const response = await fetch(`http://192.168.209.244:5000/qualitycheck`, {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(formData)
            });
            if (response.status === 401) {
                throw new Error('Network response was not ok');
            }
            const data = await response.json();
            setResult(data.description);
            console.log("User data retrieved successfully:", data);
        } catch (error) {
            console.error("Error retrieving user data:", error);
        }
    }

    const downloadImage = async () => {
        const imageUrl = 'http://192.168.209.244:5000/ssbimage';

        try {
            const response = await axios({
                method: 'post',
                url: imageUrl,
                responseType: 'blob'
            });
            const randomFileName = `${Math.floor(Math.random() * 1000)}.png`;
            setFileName(randomFileName);
            const url = window.URL.createObjectURL(new Blob([response.data]));
            setPath(url);
            const link = document.createElement('a');
            link.href = url;
            link.setAttribute('download', randomFileName);
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);
        } catch (err) {
            console.error('Error fetching image from server', err);
        }
    };

    if(text && timers)
    startTimer(5,document.querySelector('.timer'));

    useEffect(() => {
        window.onload = downloadImage;
    }, []);

    const navigate = useNavigate();   

    return (
        <div className="ssb">
            {path && (
                <div className="time">
                    <p className="timer">{result && "Result"}</p>
                </div>
            )}
            <div className="imgtest">
                <div className="img">
                    <div className="image" style={path.length && !text ? { backgroundImage: `url(${path})`, backgroundSize: 'cover', backgroundPosition: 'center' } : {}}>
