    const [backspaceCount, setBackspaceCount] = useState(0);

    const handleKeyDown = (event) => {
      const key = event.key;
      if (key === 'Backspace') {
        setBackspaceCount((prevCount) => prevCount + 1);

        let words = inputValue.split(' ');
        words.pop();
        setInputValue(words.join(' '));

        event.preventDefault();
      }

      if (backspaceCount === 2) {
        setBackspaceCount(0);
        alert("CANCELED");
        setInputValue('');
      }
    };

    async function handleSubmit(event){
        event.preventDefault();
        const formData={
            answer:document.querySelector('#placeans').value
        };
        await fetch(`http://192.168.209.244:5000/placex`, {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body:JSON.stringify(formData)
        })
        .then(response => {
            if (!response.ok) {
                throw new Error('Network response was not ok');
            }
            return response.json();
        })
        .then(data => {
            console.log("User data retrieved successfully:", data);
        })
        .catch(error => {
            console.error("Error retrieving user data:", error);
        });
    }

    return (
      <div className="placex">
        <h1>Placement Exam Practice</h1>
        <div className="place_align"><div className="place_left">
            <p>Q. Question</p>
        </div>
        <div className="place_right">
                <textarea 
                id="placeans"
                type="text" 
                value={inputValue} 
                onChange={(e) => setInputValue(e.target.value)} 
                onKeyDown={handleKeyDown}
                placeholder="Start writing the Essay..."
            />
        </div></div>
        <button onClick={handleSubmit}>Submit</button>
      </div>
    );
  };

